const Aleo300 = `@font-face { font-family: 'Aleo'; font-style: normal; font-weight: 300; src: local('Aleo Light'), local('Aleo-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const Aleo300italic = `@font-face { font-family: 'Aleo'; font-style: italic; font-weight: 300; src: local('Aleo Light Italic'), local('Aleo-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const AleoRegular = `@font-face { font-family: 'Aleo'; font-style: normal; font-weight: 400; src: local('Aleo Regular'), local('Aleo-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const AleoItalic = `@font-face { font-family: 'Aleo'; font-style: italic; font-weight: 400; src: local('Aleo Italic'), local('Aleo-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Aleo700 = `@font-face { font-family: 'Aleo'; font-style: normal; font-weight: 700; src: local('Aleo Bold'), local('Aleo-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Aleo700italic = `@font-face { font-family: 'Aleo'; font-style: italic; font-weight: 700; src: local('Aleo Bold Italic'), local('Aleo-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
